(15, 'https://drive.google.com/file/d/18Y1dXGW1-VrNqUjgLaiVdGu9o2d-JwEo/view?usp=sharing', '#', '09.2020.00001418-0', '0014/2020/PmJCRZ', '2020-05-31', 'Recomenda Ã  Secretaria de SaÃºde do MunicÃ­pio de Cruz que adote providÃªncias para garantir que os usuÃ¡rios do sistema pÃºblico de SaÃºde sejam identificados no momento da internaÃ§Ã£o por, no mÃ­nimo, pulseira de identificaÃ§Ã£o e placa de identificaÃ§Ã£o junto ao leito, com a finalidade de promover a seguranÃ§a do paciente nos serviÃ§os de SaÃºde, evitando eventuais danos e adversidades.'),
(16, 'https://bit.ly/3gxSgRo', '#', '09.2020.00001418-0', '0016/2020/PmJCRZ', '2020-07-01', 'Recomendar ao MunicÃ­pio, por meio do prefeito(a) e secretÃ¡rio(a) municipal de saÃºde, previsÃ£o, em ato normativo prÃ³prio, conforme previsÃ£o na legislaÃ§Ã£o sanitÃ¡ria, de aplicaÃ§Ã£o de multa pela inobservÃ¢ncia ao dever individual de utilizaÃ§Ã£o de mÃ¡scaras de proteÃ§Ã£o, industriais ou caseiras em todo e qualquer ambiente ou espaÃ§o publico ou privado, inclusive na rua, no interior de transporte pÃºblico ou de estabelecimento em funcionamento, bem como na Ã¡rea comum de condomÃ­nios.');
